<template>

	<img :src="src" v-if="src" style="height: 16px;" />

</template>
<script>

export default {
	name: 'Icon',
	props: {
		forWhat: String,
	},
	data() {
		return {
		}
	},
	mounted: function() {
	},
	computed: {
		src() {
			if (this.forWhat == 'opensea') {
				return `data:image/svg+xml;base64,`;
			} else if (this.forWhat == 'solscan') {
				return `data:image/png;base64,`;
			} else if (this.forWhat == 'pepperwatch') {
				return `data:image/png;base64,`;
			} else if (this.forWhat == 'solana') {
				return `data:image/png;base64,`;
			} else if (this.forWhat == 'magiceden') {
				return `data:image/png;base64,`;
			} else if (this.forWhat == 'github') {
				return `data:image/svg+xml;base64,`;
			} else if (this.forWhat == 'twitter') {
				return `data:image/png;base64,`;
			}

			return null;
		}
	}
}
</script>
